import React, { Component } from 'react';
import './Register.css';

class Register extends Component{

    state = {
        name: undefined,
        email: undefined,
        subject: undefined,
        message: undefined
    };


    render(){

        return(
            <div>
                <form>
                    <div><input type ='text' placeholder='Enter username'/></div>
                    <div><input type ='text' placeholder='Enter email'/></div>
                    <div><input type ='text' placeholder='Enter password'/></div>
                    <div><textarea type ='text' placeholder='Confirm password'/></div>
                    <div><input type ='button' value='Register'/></div>
                </form>
                <div>
                    I have account
                </div>
            </div>
        );
    }
};

export default Register;
